import Menu__background from './Menu_background/Menu__background';
import Menu from './Menu/Menu';
import Image from './Image/image';
import Gradient from './gradient/gradient';
import './header.css';

function Header(props) {
  return (
    <header>
        <Menu/>
        <Gradient/>
        <Image/>
        
    </header>
    
  );
}

export default Header;
